*
After I finished this story, I was left feeling profoundly dissapointed. I looked online to see what other people thought like I do with most stories, and I was surprised to see that I was in the minority for disliking The Dollhouse.

One of my major issues with this story is the fact that it is a spoof of Charlie‚Äôs Angels. Now, this isn‚Äôt a bad thing by any means but it forgoes any spoof-ness or even any links, narrative, thematic or stylistic to Torchwood, in exchange for a full on homage, that veers dangerously into fanfiction territory. I don‚Äôt particularly like Charlie‚Äôs Angels, so this story didn‚Äôt do a lot for me, especially since it doesn‚Äôt have a lot going on outside of the references.

The acting is atrocious. All three of the main characters are played by British women, and all three of them have various heavy accents, which are as unconvincing as they are distracting. The bad acting is backed up with dialogue ripped straight out of a Charlie‚Äôs Angels Adult Film Parody, and insensitive cultural references thrown in alongside clunky slang.

The main theme and message of this story was actually interested: how women are devalued and abused, mainly sexually, by men in positions of power. It‚Äôs actually a pretty interesting idea and it‚Äôs executed well. Unfortunately, the bad dialogue and awful performances from the main cast result in the moral getting swallowed up by an attempt at a campy 70s vibe.

Overall, The Dollhouse had potential, and it probably does appeal to people who enjoy Charlie‚Äôs Angels. However, that‚Äôs what this is: just a Charlie‚Äôs Angels episode, not an episode of Torchwood
